import React from "react";
import './Home.css'

const Home = () => {
    return <div className="homeMain">
            <h1>Welcome To Stranger's Things!</h1>
            <p>...where one person's trash is another's treasure!</p>
            <img src="../videos/hoarderPic.jpg" alt="hoarderic" />
            </div>
}
export default Home;
